script: |
  super -f text -I q1369.spq | sort > q1369.out

inputs:
  - name: q1369.spq
    data: |
      SELECT d-e,
      a,
      b
      FROM t1 (FORMAT parquet)
      WHERE (e>a AND e<b)
      AND d NOT BETWEEN 110 AND 150
      ORDER BY 2,3,1;
  - name: t1

outputs:
  - name: q1369.out
    data: |
      -2	191	194
      1	220	223
      2	245	249
